  true,\n\t\"url\": null,\n\t\"notes\": \"The Program for International Student Assessment,
  2009 (PISA:09), is a study that is part of the Program for International Student
  Assessment (PISA) program. PISA:09 (http://nces.ed.gov/surveys/pisa/) is a cross-sectional
  study that measures the yield of education systems, or what skills and competencies
  students have acquired and can apply in reading, mathematics, and science to real-world
  contexts by age 15. For PISA:09, reading literacy was the subject area assessed
  in-depth. The study was conducted using questionnaires and direct assessments of
  15-year-old students. 15-year-old students in April to May of 2009 were sampled.
  The studyufffds response rate was 87 percent. Key statistics produced from PISA:09
  are 15-year-olds' capabilities in reading, mathematics, and science literacy.\",\n\t\"license_title\":
